import React from "react";
import { projectList } from "../helpers/ProjectList";
import { projectDetail } from "../helpers/ProjectDetail";

function Meta({ name }) {
  const project = projectDetail.find(({ p }) => p.name === name);
  <div>
    {project.content.map((ele, value) => {
      if (ele.includes("text")) {
        return <img src={value} alt="project" />;
      } else if (ele.includes("image")) {
        return <p> {value}</p>;
      }
      return <div></div>;
    })}
    <p> {project.intro}</p>
  </div>;
}

export default Meta;
